<?php $__env->startSection('content'); ?><p>New South Wales has recorded another five new coronavirus cases as fears surround a cluster growing at a Sydney pub.</p>

<p>Two infections have come from those in hotel quarantine while another two are linked to a known cluster.</p>

<p>The other new case recorded on Thursday is still under investigation but has been locally acquired. </p>

<p>One of the cases had attended the Eastern Suburbs Legion Club in Waverly in Sydney's eastern suburbs.</p>

<p>The cluster at the pub has now grown to nine.  </p>

<p>NSW has recorded five new cases of COVID-19 with two in hotel quarantine (two women wear face masks in Circular Quay)</p>

<p>Diners who attended a thai restaurant in Casual in Sydney's south-west have also been urged to get tested immediately. </p>

<p>'Anyone who attended the Five Stars Thaitanic, Casula on Saturday 12 September from 4.20pm-5.20pm is considered a casual contact and must monitor for symptoms and get tested immediately if they develop,' NSW Health said.</p>

<p>'After testing, they must remain in isolation until a negative test result is received.'</p>

<p>More to come. </p>
